import React from 'react';
import ReactDOM from 'react-dom';

const AppHeader = () => {
  return <h1> My Todo List </h1>;
};

const SearchPanel = () => {
  const searchText = 'Type here to search';
  return <input placeholder={searchText}/>;
};

const TodoList = () => {
  const items = ['Drink Coffee', 'Build App'];
  return(
    <ul>
      <li> {items [0]} </li>
      <li> {items [1]} </li>
    </ul>
  );
};

const App = () => {
  return(
    <div>
       <AppHeader />
       <TodoList />
       <SearchPanel />
    </div>
  );
};

ReactDOM.render(< App />,
  document.getElementById('root'));
